function Login(){
    return(
        <div>
            <form>
                <h1>LOGIN</h1>
                <label>First Name:</label><br/>
                <input type="text" id="fname"/><br/>
                <label>Last Name:</label><br/>
                <input type="text" id="lname"/><br/>
                <button type="button" onClick={navigateHome}>Submit</button>
            </form>
        </div>
    )
}

export default Login;
